// import logo from './logo.svg';
import { BrowserRouter as Router1 } from 'react-router-dom';
import RegistrationForm from './components/RegistrationForm.js';

import './App.css';

function App() {
  return (
    <div className="App">
      <Router>
        <Router1 path="/registration" component={RegistrationForm} />
      </Router>
    </div>
  );
}

export default App;
